import React from "react";
import { useLocation } from "react-router-dom";
import QRCode from "qrcode.react";
import "./QRView.css";

const QRVIEW = () => {
    const location = useLocation();
    const qrDataArray = location.state?.qrDataArray || [];

    return (
        <div className="MainView">
            <div className="View">
                <h1 className="headQR">QR Codes</h1>
                <div className="qr-container">
                    {qrDataArray.map((data, index) => (
                        <div key={index} className="qr-item">
                            <h4>{data.assetName} ({data.component || "Single Item"})</h4>
                            
                            <p>Tracking ID: {data.trackingId}</p>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default QRVIEW;
